            .then(
                res=> {
                alert('Connection Success!!')

            }).catch(
                e => alert('Faiulure')
            )
    }

    return(<>
        <table className='tab_layer'>
            <tr><td><h1>Home</h1></td></tr>
            <tr><td><button onClick={test}>Connection Test</button></td></tr>
        </table>
        </>
    )

}
export default Home
